{"de": "#### Lokalisierung

Bitte tragen Sie die Adresse Ihres Bauvorhabens in die Zeile ein oder klicken Sie in die nachfolgende Karte um die Lage des Bauvorhabens in der Karte zu verorten. 

Sie können einen Punkt, eine Linie oder eine Fläche in der Karte zeichnen.", "fr": "", "it": ""}

{"de": "<div class="uk-alert"><p>Wenn die hier erfasste Person zusätzlich Zugang zum Dossier erhalten und über dessen Bearbeitungsfortschritt informiert werden soll, erfassen Sie diese im Menü "Berechtigungen".</p>

<p>Um auf das Dossier zuzugreifen, muss die eingeladene Personen auf dem eBau Portal registriert sein. Falls dies noch nicht der Fall ist, wird bei der Einladung automatisch eine E-Mail mit einem Link zur Registrierung versendet.</p></div>", "fr": "<div class="uk-alert"><p>Si la personne saisie ici doit également avoir accès au dossier et être informée de l'avancement du projet, saisissez cette personne dans le menu "Autorisation".</p> 

<p>Pour accéder au dossier, la personne invitée doit être enregistrée sur le portail eBau. Si ce n'est pas encore le cas, un e-mail contenant un lien vers l'enregistrement sera automatiquement envoyé avec l'invitation.</p></div>", "it": ""}

fields.info_text:
{"de": "Nach Art. 89 Abs. 3 des kantonalen Raumplanungsgesetzes (KRG) ist das Baugesuch zwingend durch die Bauherrschaft zu unterzeichnen. 

Ist die Bauherrschaft nicht Eigentümerin der Liegenschaft, ist das Baugesuch durch die Eigentümerin oder den Eigentümer mitzuunterzeichnen.

Die Unterschriften werden am Schluss des Eingabeprozesses auf die  Eingabequittung, die auszudrucken ist, gesetzt.", "fr": null, "it": null}

{"de": "Der Zonenplan unterteilt das Gemeindegebiet in verschiedene Nutzungszonen (Bauzonen, Landwirtschaftszonen, Schutzzonen und weitere Zonen). 

Die Zonen der Grundnutzung bestimmen allgemein die zulässige Nutzung des Bodens. Die Zonen überlagerter Nutzung enthalten ergänzende Nutzungsvorschriften.

Diese Informationen werden direkt aus dem GIS abgefüllt.", "fr": null, "it": null}
